import React from 'react';
import '../components/design-files-css/SideMenu.css';
import { useHistory } from 'react-router';

const SideMenuComponent = () => {
  const history = useHistory();

  const handleNavigate = (path) => {
    history.push(path);
  };

  const handleLogout = () => {
    // Perform the logout operation here, e.g., clearing a token or session.

    // After performing the logout operation, redirect to the login page.
    history.push('/login');
  };

  return (
    <div className="side-menu">
      <ul>
        <li>
          <button className="nav-button" onClick={() => handleNavigate('/page1')}>
            Go to Page 1
          </button>
        </li>
        <li>
          <button className="nav-button" onClick={() => handleNavigate('/page2')}>
            Go to Page 2
          </button>
        </li>
        <li>
          <button className="nav-button" onClick={() => handleNavigate('/page3')}>
            Go to Page 3
          </button>
        </li>
        <li>
          <button className="nav-button" onClick={handleLogout}>
            Logout
          </button>
        </li>
      </ul>
    </div>
  );
};

export default SideMenuComponent;
